$values = array();
$LowerArr = range('a', 'z') ;
$upperArr = range('A', 'Z') ;
//print_r($LowerArr);
foreach($input as $s ){
    //echo "<br>";
    $compartment_count = strlen($s)/2;
   // echo $compartment_count . '<br>';
    $first_comp = substr($s, 0, -$compartment_count);  // returns "abcde"
    $second_comp = substr($s, -$compartment_count);    // returns "f"
    
    
   // echo $s ."<br>"; 
    //echo $first_comp."<br>";  
    //echo $second_comp."<br>"; 
    $chars = str_split($first_comp);
    foreach($chars as $char){
        if(str_contains($second_comp, $char)){
      //      echo $char."<br>";
            $duplicate = $char;
        }
    }
    if(ctype_upper($duplicate)){
       // echo 'upper';
        $values[] = (array_search($duplicate, $upperArr) + 27); 
    }else{
        $values[] = (array_search($duplicate, $LowerArr) + 1); 
    }
}
$sum = 0;
foreach ($values as $value){
    $sum = $sum + $value;
}
echo '<br>' . $sum;